//lewisbritton.com/documents/employment/cv.pdf)"}]},tileTwo:{type:"solid",heading:"Overview",sections:[{component:"body",content:{body:"To be written ..."}}]},tileThree:{type:"solid",heading:"Employment",subHeading:"All the wage\u2019ing",sections:[{component:"body",content:{body:[{variant:"h3",children:"Scottish Power UK PLC | Software Engineer | 2022\u2013Present"},{variant:"body",children:"To be written ..."},{variant:"h3",children:"Costa Coffee | Barista | 2021"},{variant:"body",children:"A first-time barista at the Glasgow Central Station Costa Coffee. As expected, this involves various fun and relaxing roles such as front-of-house customer interactions, including the rush-hour(s) mobs; till and cash manaegement; stock management; cleaning and basic maintenance of tools and equipment; and of course, making a stunning array of coffees and cold drinks."},{variant:"h3",children:"Virtuous Truffle Company | Sole Owner | 2019\u20132021"},{variant:"body",children:"I care for the production of high quality luxury goods. This premium confectionery company was my way of presenting my na\xefve, retired love for indulgence and extravagance. But more importantly, high quality production methods. It allowed me to showcase and develop business management \u2018skills\u2019 such as stock management and optimization, financial record keeping, operations management, marketing and graphic design. I utilized some bloated Soyftware such as Adobe Photoshop, Serif PagePlus and Autodesk Inventor, while maintaining the VTC website."},{variant:"h3",children:"Lakeland PLC | Retail Assistant | 2019\u20132020"},{variant:"body",children:"It started as completing morning deliveries like Jeff Bezos on day one, to selling a record number of products like The Wolf while on front of house demonstrations \u2013 400% more than the runner-up on my best performing day. Lakeland offered me development from all angles, social and economic. I\u2019ve received multiple cases of praise regarding my \u2018impeccable\u2019 customer service and understanding of social desires. I was trusted to open and close store, manage the store funds and stock and have perpetual input in the store marketing and sales. I provided a strong, kind and reliable face by adopting a customer-centric nature. My excellent relationship with my boss allowed transparency and freedom which translated to efficiency and a strong understanding of operations. Lakeland is a place of strong hierarchical and consumer intimacy and thus, provided me with great joy."},{variant:"h3",children:"J Sainsbury PLC | Customer Assistant | 2018"},{variant:"body",children:"I was responsible for the primary operations such as till and cash management, stock management, handling of lottery, liquor and tobacco, and general store maintenance. The Sainsburys \u2018Think 25\u2019 protocol introduced me to analysing and identifying human age at a rapid pace while serving particular customers. I was presented with \u2018challenges\u2019 such as attempted violence and extremely minor robberies. These were a great opportunity for developing my management of people."},{variant:"h3",children:"Sedgwick PLC | Customer Service Agent | 2018"},{variant:"body",children:"I managed traffic from policyholders, clients and adjusters within the communication wing of their Glasgow office. I implemented a complex database directory with simultaneous tasks in ambition to connect and satisfy policyholders, clients and my employer. I balanced care for the client and policyholder through composure and vigilance regarding provoked policyholders, diffusing confrontation."}]}}]}};var r=n(184);const o=()=>{const t=[(0,r.jsx)(i.d7,{...a.tileOne}),(0,r.jsx)(i.Ld,{...a.tileTwo}),(0,r.jsx)(i.Ld,{...a.tileThree})];return(0,r.jsx)(i.Xg,{background:a.background,children:t})}},852:(t,e,n)=>{"use strict";n.d(e,{j:()=>r});var i=n(5143),a=n(184);const r=()=>{const t=[(0,a.jsxs)("div",{id:"error-page",children:[(0,a.jsx)("h1",{children:"Dayum!"}),(0,a.jsx)("p